//                  MAKING FULL-STACK DEVELOPER LIST PROFILE'S COMPONENT                  \\

// Importing Requried Modules :
import React from 'react';

// Importing Components :
import Prs from './Profile'

// Importing CSS :
import "./index.css"

// Importing Array That contain Data of Profiles :
import ProfileData from './ProfileData';



function Full() {
    return (
        <>
            {ProfileData.map((ind) => {
                return (
                    <Prs
                        key={ind.id}
                        proname={ind.proname}
                        proimg={ind.proimg}
                        prolink={ind.prolink}
                    />
                )
            }
            )}
        </>
    )
};


// Exporting the App Component :
export default Full;
